import React from "react";
import "./OnBording1.css";
import { Link } from "react-router-dom";
import img from "../Assets/OnBording2.png";
function OnBording1() {
  return (
    <div
      className="OnBording1"
      style={{
        backgroundImage: { img },
      }}
    >
      <div className="OnBording1_inner">
        <div className="OnBording1_inner_Top">
          <h5>
            Food-<span>D</span>
          </h5>
        </div>
        <div className="OnBording1_inner_Bottom">
          <h1>
            AWESOME <br /> <span>LOCAL </span>FOOD
          </h1>
          <h5>
            Discover delicious food from the amazing <br /> restaurants near you
          </h5>
          <Link to="/OnBording2">
            <button type="button">NEXT</button>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default OnBording1;
